import { Link } from "react-router-dom";
import '../css/Header.css';
import footballLogo from '../img/football.png';
import homeIcon from '../img/home-icon.png';

function Header() {

    return(
        <div className="header">
            <div><Link to="/"><button className="home-icon-button"><img className="home-icon" src={homeIcon} alt="home icon" /></button></Link></div>
            <img className="football-logo" src={footballLogo} alt="football logo" />
            <h1 className="title">KickBuddy</h1>
            <img className="football-logo" src={footballLogo} alt="football logo" />
        </div>
    );

}

export default Header;
